                                                                    '),('1217280615032316115505N6','<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: medium;\">Promoci&oacute;n Cuarto Contingente 93 &nbsp;( Balim-5 )</span></strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">Ven y participa de la actividad de nuestra promoci&oacute;n&nbsp;<strong> Julio Belleza</strong> mas </span></p>\r\n<p><span style=\"font-size: medium;\">conocido como kemoly</span></p>\r\n<p><span style=\"font-size: medium;\">el 28 de Marzo del 2015</span></p>\r\n<p><span style=\"font-size: medium;\">Direcci&oacute;n Calle los corales 443 balconcillo - La victoria ... en el cevichon</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">(a espaldas entre av. Mexixo y Palermo)</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">Mas informacion <strong>969925180</strong></span></p>'),('121728061504131703259TM9','<p>Como es costumbre de nuestra Promocion Vladimir Ballardo (el Arabe) del cuarto Contingente Noviembre 93 (balim-5), prepara una Cevichada entre febrero &nbsp;y Marzo.</p>'),('12172806150414152953L3FU','<p style=\"text-align: justify;\"><span style=\"font-size: small;\">La promocion cuarto contingente noviembre 93 &nbsp;- ex infantes de Marina del Per&uacute; , se solidarizan </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">con la promoci&oacute;n belleza en su actividad pro salud&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\">Siempre unidos....................</span></p>'),('1217280615041415594387G8','<p>Un cumplea&ntilde;os de la amiga de harry &nbsp;algunas de nuestras promociones presentes cuarto contingente noviembre &nbsp;93 - balim 5</p>'),('12172806150414232439BETI','<p>Un fin de semana 4 de abril 2015 &nbsp;con la promocion cuarto contingente 93&nbsp;</p>'),('12172806150419151638R1LV','<p>&nbsp;</p>\r\n<p><iframe style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.youtube.com/embed/QYR_lmWqRfA?autoplay=0;rel=0\" frameborder=\"0\" width=\"425\" height=\"350\"></iframe></p>'),('12172806150420034445G7B1','<p><br />Se preparara una Pachamancada &nbsp;que sera de cortesia para degustar con los amigos(as) , la promo del <strong>cuarto contingente Nov. 93 ,</strong></p>\r\n<p>Se a invitado al sgto Goicochea el Tunche.</p>\r\n<p>&nbsp;Referencia Ov Canta Callao , por el complejo deportivo Full Gol y hotel paradize</p>\r\n<p>Urb Boulevar de naranjal Mz D Lote 7 San Martin de Porres<br /><br /></p>\r\n<p>A partir de las &nbsp;2 pm hasta quemar el ultimo cartucho</p>\r\n<p>LLamar Huiza &nbsp;996272600</p>\r\n<p>VER CROQUIS :</p>'),('121728061504280157371SW7','<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Un fin de semana 25 de abril del 2015 con la promo cuarto contingente noviembre 93</p>'),('12172806150428205145MY8W','<div class=\"_5pbx userContent\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Promociones yo se que cuando me invitan por motivo de trabajo no puedo asistir pero el d&iacute;a 2 de mayo habr&aacute; un almuerzo en mi casa en jr Cuzco 331 san Juan de lurigancho les mando un croquis y rock es 954177892 los espero para disfrutar de un momento agradable de parrilla los espero carajo vengan a partir de las 3 pm no falten</span></p>\r\n<span class=\"userContentSecondary _c24\" style=\"font-size: small;\">&nbsp;</span></div>\r\n<div><span style=\"font-size: small;\">&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"cuarto-contingete-nov-93-balim-5-Fleishman-Culqui-foto-portada.jpg\" src=\"/webadmin/tiny_mce/plugins/jfilebrowser/archivos/20150428210053_0.jpg\" alt=\"cuarto-contingete-nov-93-balim-5-Fleishman-Culqui-foto-portada.jpg\" /></span></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</d