ont-size: medium;\">scotiabank </span><br /><span style=\"font-size: medium;\">Tipo de cuenta : Cuenta de Ahorros</span><br /><span style=\"font-size: medium;\">Cta Soles S/. : 022-7379773</span><br /><span style=\"font-size: medium;\">Titular : Huiza Quispe Alexzander</span><br /><span style=\"font-size: medium;\">cualquier consulta me pueden llamar al 926272600 promo huiza</span></p>\r\n<p>&nbsp;</p>\r\n<p>Segunda Lista por entregar&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/imagen/IMG_20150903_0006%20-sinmonto.jpg\" alt=\"\" width=\"582\" height=\"307\" /></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium; color: #ff0000;\"><strong>&nbsp;Las Promos que se han Solidarizado con la Promo angel Campos Salvatierra&nbsp;</strong></span></p>'),('12172806150920152212KFIT',''),('121728061509231518531IXA','<p style=\"text-align: center;\"><span style=\"font-size: large;\">Se le comunica a Nuestros Hermanos Infantes</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><span style=\"font-size: large;\">Que este <span style=\"color: #ff0000;\">Sabado 3 de octubre</span> se estara haciendo una <span style=\"color: #ff0000;\">pollada pro salud</span> por la promo&nbsp;<a href=\"https://www.facebook.com/acampossalvatierra\">angel campos salvatierra</a>&nbsp; <span>Costo 10 Soles la Pollada</span><span>&nbsp;</span><span>,&nbsp;</span>se les espera&nbsp;a todos llanos a colaborar,pasen la voz y comuniquen y separen sus polladas y,ofrescan a sus amistades..todos como hermanos.</span></p>\r\n<p><span style=\"font-size: large;\">Lugar : de la actividad,altura de la cuadra 16 de la av naranjal, Calle yaracmarca 5113-5117-urb pque del naranjal, 2da etapa los olivos,</span></p>\r\n<p><span style=\"font-size: large;\">Pasando el ovalo de huandoy esta la polleria norkys,al frente esta la calle yaracmarca,de ante mano se les agradece su colaboracion.atte.un integrante de la promo,nov-93...el arabe !!!!!</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: large;\">Cualquier consulta llamar promo huiza 996272600</span></p>\r\n<p>&nbsp;</p>\r\n<center>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\">1)ivan heredia sotelo 2 polladas</span><br /><span style=\"font-size: medium;\">2)riki perez 1 pollada</span><br /><span style=\"font-size: medium;\">3)kike yataco 3 polladas por confirmar si desea mas</span><br /><span style=\"font-size: medium;\">4)Martin Rios 4 polladas&nbsp;</span><br /><span style=\"font-size: medium;\">5)Dick Harry Cabrera Ruiz 20 polladas por confirmar si desea mas&nbsp;</span><br /><span style=\"font-size: medium;\">6)Edson Jose Soto 3 pollos</span><br /><span style=\"font-size: medium;\">7)wilmer reyes 2 polladas</span><br /><span style=\"font-size: medium;\">8)Edward Fretel S 4 polladas</span><br /><span style=\"font-size: medium;\">9)Javier Sanchez Narvaez 5 polladas vendra al peru ese dia&nbsp;</span><br /><span style=\"font-size: medium;\">10)Vladimir Ballardo 15 Polladas por confirmar si desea mas</span><br /><span style=\"font-size: medium;\">11)Huiza Quispe 5 Polladas</span><br /><span style=\"font-size: medium;\">12)Jaime Rivera (maelo) 2 Polladas</span><br /><span style=\"font-size: medium;\">13)Galop Lopez 5 Polladas</span><br /><span style=\"font-size: medium;\">14)Mikeminas Mikeminas se hara presente&nbsp;</span><br /><span style=\"font-size: medium;\">15)Davis Francisco Vargas Cardenas se hara presente</span><br /><span style=\"font-size: medium;\">16)Roberto Ore Sutta 2 Polladas</span><br /><span style=\"font-size: medium;\">17)Davico Hs 2 Polladas</span><br /><span style=\"font-size: medium;\">18)Douglas Zu&ntilde;iga Espinoza 3 Polladas</span><br /><span style=\"font-size: medium;\">19)Raul Andia 10 polladas</span><br /><span style=\"font-size: medium;\">20)Chester Alfaro 2 Polladas</span><br /><span style=\"font-size: medium;\">21)Miguel Valencia Luyo 2 Polladas Estare plan de 7pm m lo guardan</span><br /><span style=\"font-size: medium;\">22)Julio Juan Belleza Panta 4 Polladas</span><br /><span style=\"font-size: medium;\">23)Luis Felipe Vargas (pipo) 1 Pollada</span><br /><span style=\"font-size: medium;\">24)Carlos Manuel Marcos Serpa 1 Pollada</span><br /><span style=\"font-size: medium;\">25)Miguel Cuevas Guillen se hara presente</span><br /><span style=\"font-size: medium;\">26)Richard Ivan Garcia Rodriguez 2 Polladas</span><br /><span style=\"font-size: medium;\">27)Jose Alarcon 6 polladas(3 pechos y 3 piernas)</span><br /><span style=\"font-size: medium;\">28)Hilton Flores 2 Polladas</span><br /><span style=\"font-size: medium;\">29)Marco Antonio Luque Pari 1 Pollada</span><br /><span style=\"font-size: medium;\">30)Walter Alvarado Cordova 1 pollada</span><br /><span style=\"font-size: medium;\">31)Jesus Angel Mu&ntilde;oz Zevallos(Cobra) 1 pollada</span></p>\r\n</center>'),('121728061509252348305LMM','<p style=\"text-align: center;\"><span style=\"font-size: medium;\">Hoy un dia especial &nbsp;un a&ntilde;o mas de vida , que el dios todopoderoso te llene de salud y felicidad&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\">y a toda tu familia</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\">Te desea toda la promo Cuarto Contingente &nbsp;Nov. 93</span></p>'),('12172806151002190400NZ5X',''),('12172806151006162928LY1J','<p><span style=\"font-size: large;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: large;\">Feliz cumpleanos Promo Martius Puertas y Promo Julio Cesar Orme&ntilde;o Rojas</span></p>\r\n<p><span style=\"font-size: large;\">Te desea toda la promo cuarto contingente noviembre 93</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),('12172806151007155223VYW9',''),('12172806151007180713UGRO',''),('12172806151008232109NXNL',''),('12172806151011012156W4HY',''),('12172806151014202641IFUW',''),('12172806151015183555PCXF',''),('121728061510181547132J0G',''),('12172806151025002940BU2S',''),('12172806151026233419MCMW','<p style=\"text-align: center;\">Urgente</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">1) Se hace un llamado con caracter de urgencia a toda la promo del (4to Contingente Nov-93 de las diferentes cia) a inscribirse para la segunda visita a la base de infanteria de ancon que sera el </span><br /><span style=\"font-size: medium;\">dia 21 NOVIEMBRE 2015 debemos estar 8:00 am en la base de ancon, </span><br /><span style=\"font-size: medium;\">ultimo dia de inscripcion 31 DE OCTUBRE 2015 , dejar nombe completo y dni , </span><br /><span style=\"font-size: medium;\">se podra llevar 3 invitados por titular y los &ntilde;inos deven ser mayores de 10 a&ntilde;os , personal encargado </span><br /><span style=\"font-size: medium;\">para la inscripcion la promo Singlenthon Merino Rodriguez. (Inscripcion pagina del Balim-5)</span></p>'),('12172806151114163157230E','                                        <p align=\"center\"><span style=\"font-size: medium; color: #ff0000;\"><strong>COMUNICADO Visita Ancón 21 Noviembre 2015</strong></span></p>\r\n<p align=\"center\"><span style=\"font-size: medium;\"><strong>A toda la promoción 4to Contingente Noviembre&nbsp; 93</strong></span></p>\r\n<p><span style=\"font-size: medium;\"><strong>&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\"><strong>La Movilidad será totalmente <span style=\"color: #ff0000;\">GRATIS</span>&nbsp; </strong></span></p>\r\n<p><span style=\"font-size: medium;\"><strong>gracias a la promocion Dick Harry Cabrera Ruiz &nbsp;&nbsp;y &nbsp;la Promo Galop Lopez</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">1)&nbsp;&nbsp;&nbsp; Se Recogera a la promocion en <strong><span style=\"color: #ff0000;\">Acho</span></strong> de 6:00 a 6:40 am</span></p>\r\n<p><span style=\"font-size: medium;\">2)&nbsp;&nbsp;&nbsp; En <strong><span style=\"color: #ff0000;\">Pilas de la Panamericana Norte</span> </strong>se hara la 2da &nbsp;parada&nbsp; de&nbsp; 7:00 a 7:20 am</span></p>\r\n<p><span style=\"font-size: medium;\">3)&nbsp;&nbsp;&nbsp; En la <strong><span style=\"color: #ff0000;\">1ra PRO</span></strong>&nbsp; se hara una Parada&nbsp; de&nbsp; 7:40 a 7:50 am</span></p>\r\n<p><span style=\"font-size: medium;\">HORARIO DE LLEGADA 08.40 a la Base de Ancon</span></p>\r\n<p><span style=\"font-size: medium;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: medium;\"><strong>NOTA IMPORTANTE : </strong>De Regreso la Movilidad Nos llevara a la</span></p>\r\n<p><span style=\"font-size: medium;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<strong><span style=\"color: #ff0000;\">Actividad&nbsp;&nbsp; Pro Salud de la Promo Angel Campos Salvatierra</span></strong> . CDRA 20 AV.MEXICO - LA VICTORIA.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\"><strong>NOTA IMPORTANTE </strong><strong>:</strong> &nbsp;</span><span style=\"font-size: large;\">Las promociones que no se encuentren en la lista se les adicionara&nbsp; el día 21de noviembre antes de ingresar&nbsp; a la base.</span></p>                                          '),('12172806151128233508VT30','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: large;\">COMUNICADO FALLECIMIENTO</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: large;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: large;\">Lamentamos comunicarle que nuestra promocion Angel Campos Salvatierra​ fallecio hoy sabado 28 noviembre a las 4pm</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p><span style=\"font-size: large;\">&nbsp;</span><span style=\"font-size: large;\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\"><span class=\"UFICommentBody _1n4g\">Promociones Hoy 30 Noviembre 2015 sera el entierro de nuestro compa&ntilde;ero&nbsp;<a class=\"profileLink\" dir=\"ltr\" href=\"https://www.facebook.com/acampossalvatierra?hc_location=ufi\" target=\"_blank\" data-hovercard=\"/ajax/hovercard/hovercard.php?id=1101130202&amp;extragetparams=%7B%22hc_location%22%3A%22ufi%22%7D\">Angel Campos Salvatierra</a>&nbsp;se empezara con una misa a las 10am en la parroquia NUESTRA SENORA DEL BUEN CONSEJO,a la altura de la cuadra 20 de la Av. M&eacute;xico a espalda del colegio C&eacute;sar Vallejo. (en el mismo sitio de la actividad que realizo), e inmediatamente nos iremos al cementerio PADRE ETERNO (ubicado a espalda del cementerio EL ANGEL) siendo la hora de entierro a la 1pm</span></span></p>'),('12172806160219205445QYIM','');

